import React from "react";
import { Link } from "react-router-dom";
import AppointmentForm from "../../layout/AppointmentForm";
import PatientList from "../../layout/PatientList";
import ".";

const Dashboard: React.FC = () => {
  // Exemplo: Número total de pacientes e consultas agendadas
  const totalPatients = 100;
  const scheduledAppointmentsToday = 15;

  return (
    <div className="dashboard-container">
      <h1 className="dashboard-title">Dashboard</h1>
      <div className="dashboard-links">
        <Link to="/appointment" className="dashboard-link">
          Agendar Consulta
        </Link>
        <Link to="/patients" className="dashboard-link">
          Lista de pacientes
        </Link>
      </div>
      <div className="dashboard-card">
        <div className="dashboard-info">
          Total de Pacientes: <strong>{totalPatients}</strong>
        </div>
        <div className="dashboard-info">
          Consultas Agendadas para Hoje:{" "}
          <strong>{scheduledAppointmentsToday}</strong>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
